import React from 'react';

class Item extends React.Component {
  render() {
    return (
      <li>{this.props.name}</li>
    )
  }
}

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>Hello React</h1>
        <ul>
          <Item name="Mac"/>
          <Item name="Microsoft"/>
          <Item name="Linux"/>
        </ul>
      </div>
    )
  }
}

export default App;
